  function sign(x)

    return x < 0 ? -1 : x > 0 ? 1 : 0;
  }

  function _mix(a, b, amount)
  {
    return ((1.0 - amount) * a) + (amount * b);
  }

  function _log(x, base)
  {
    return Math.log(Math.abs(x)) / Math.log(base);
  }

  {

    var right = Math.max(a, b);
    return left <= x && x <= right;
